LDAP_Sync_User_Data_Channels_GroupMember:
Xác định cách xác thực tư cách thành viên của người dùng đối với nhóm LDAP.  
 - **Áp dụng bộ lọc cho từng nhóm**: áp dụng bộ lọc nhóm người dùng LDAP cho từng nhóm (khóa) được xác định trong bản đồ kênh của nhóm LDAP. Việc này chậm hơn nhưng có thể hữu ích trong trường hợp bạn cần sử dụng thẻ thay thế `#{groupName}` để xác định tư cách thành viên;  
 - **Áp dụng bộ lọc một lần để có được tất cả tư cách thành viên**: áp dụng bộ lọc nhóm người dùng LDAP một lần cho mỗi người dùng. Một người dùng nhất định sẽ được coi là thành viên của tất cả các nhóm được tìm kiếm LDAP trả về. Đây là tùy chọn **nhanh hơn** có thể được áp dụng trong trường hợp thẻ thay thế `#{groupName}` không được bộ lọc sử dụng (ví dụ: khi lọc theo trường `thành viên` trong nhóm).

